{"title": "Altec Lansing Thunder 15 Rechargeable Weather Resistant Portable Speaker - Sam's Club", "price": 199.88, "image_urls": ["https://scene7.samsclub.com/is/image/samsclub/0074770500708_A?", "https://scene7.samsclub.com/is/image/samsclub/0074770500708_B?", "https://scene7.samsclub.com/is/image/samsclub/0074770500708_C?", "https://scene7.samsclub.com/is/image/samsclub/0074770500708_D?", "https://scene7.samsclub.com/is/image/samsclub/0074770500708_E?"], "product_id": ["980200489"], "description": "The Altec Lansing Thunder 15 is the ultimate water-resistant, super portable, LED speaker \u2013 all in one package. Enjoy sound that is clear, crisp, and with balanced bass. Its beat-driven party lights with some intense bass are a blast for party lovers. Boasting an IPX4 rating, it is a waterproof speaker means it can be taken to the pool party as well as to the late night after party. Thanks to its integrated retractable handle and smooth rolling wheels, this feature-packed speaker has you covered while on-the-go.", "images": [{"url": "https://scene7.samsclub.com/is/image/samsclub/0074770500708_A", "path": "altec-lansing-thunder-15-rechargeable-weather-resistant-portable-speaker-sam-s-clubhttps-scene7-samsclub-com-is-image-samsclub-0074770500708-a.jpg", "checksum": "c55ca38b59c1a22ee4602fb02cf3b5e2"}, {"url": "https://scene7.samsclub.com/is/image/samsclub/0074770500708_B", "path": "altec-lansing-thunder-15-rechargeable-weather-resistant-portable-speaker-sam-s-clubhttps-scene7-samsclub-com-is-image-samsclub-0074770500708-b.jpg", "checksum": "65fe3579b12590a495d30b4e4a38ec9f"}, {"url": "https://scene7.samsclub.com/is/image/samsclub/0074770500708_C", "path": "altec-lansing-thunder-15-rechargeable-weather-resistant-portable-speaker-sam-s-clubhttps-scene7-samsclub-com-is-image-samsclub-0074770500708-c.jpg", "checksum": "4144c27c27f5169e7d656737a636b314"}, {"url": "https://scene7.samsclub.com/is/image/samsclub/0074770500708_D", "path": "altec-lansing-thunder-15-rechargeab