{"title": "Audio-Technica ATH-MSR7NC High-Resolution Headphones with Active Noise Cancellation\t - Sam's Club", "price": "not available", "image_urls": ["https://scene7.samsclub.com/is/image/samsclub/0496131013344_A?", "https://scene7.samsclub.com/is/image/samsclub/0496131013344_B?", "https://scene7.samsclub.com/is/image/samsclub/0496131013344_C?", "https://scene7.samsclub.com/is/image/samsclub/0496131013344_D?"], "product_id": ["140707"], "description": "The ATH-MSR7NC headphones combine the hi-res audio technology and design features from the original ATH-MSR7 with newly developed active-noise cancelling technology to bring you the ultimate listening experience. These headphones are outfitted with exclusive 45 mm True Motion Drivers to deliver distortion-free audio reproduction with extended frequency response. A miniature microphone is incorporated into the top of each earcup to pick up ambient noise that can then be blocked by an appropriate sound-cancelling signal when the active noise-cancelling function is activated. Having the microphone on the top, instead of on the side, of the housing ensures consistent noise cancellation unaffected by the user\u2019s head movement or by wind noise. Each earcup also has an acoustic vent, ideally positioned on the side of the housing, 90 degrees from mic, to enhance tuning without negatively affecting sound quality. The result is consistent hi-res audio reproduction whether in active or passive noise-cancelling modes. The ATH-MSR7NC\u2019s highly flexible swivel design, along with its soft, memory foam earpads and headband, ensure lasting comfort even during the longest listening sessions. The headphones also come with two detachable cables: 1.2 m (3.9') standard cable and a 1.2 m (3.9') cable with in-line controls and microphone for use with smartphones. An internal 3.7V lithium polymer battery powers the active noise-cancelling function and can easily be recharged using the included USB charging cable.", "images": [{"url