{"title": "Ion Audio Charge Time Plus - Various Colors - Sam's Club", "price": 59.88, "image_urls": ["https://scene7.samsclub.com/is/image/samsclub/0084265510166_A?", "https://scene7.samsclub.com/is/image/samsclub/0084265510166_B?", "https://scene7.samsclub.com/is/image/samsclub/0084265510166_C?"], "product_id": ["980223926"], "description": "Wirelessly charge your phone and wake up to stereo music! We\u2019ve all got to do things in life we don\u2019t like\u2014like getting up on time. We\u2019ve also got to remember to perform those necessary tasks to ensure that tomorrow goes well\u2014like recharging our phone the night before. With Charge Time Plus, you\u2019ll never wake up in the morning with that dreaded \u201cI forgot to plug in my phone last night\u201d feeling. That\u2019s because Charge Time Plus has wireless recharging capability that works with any compatible Apple or Android phone. Simply lay your phone down on the top-mounted recharge pad and you\u2019re done. No more \u201cI didn\u2019t recharge\u201d morning panic attacks. Charge Time Plus is the perfect device to help keep your life\u2019s schedule on track. This is a stereo alarm clock that streams music from any Bluetooth\u00ae-enabled device. It has two speakers, alarm, a bright, clear LED time/temp display and silent, touch-capacitive control buttons. Its USB charge port lets you recharge a second phone at the same time you\u2019re using the charging pad. It also has five built-in sleep sounds to help ease you into that well-deserved slumber. Plus, it has a 3.5mm aux input so you can connect non-Bluetooth devices. Charge Time Plus definitely does its part to keep you organized, well-rested and on time. Everything else is up to you.", "images": [{"url": "https://scene7.samsclub.com/is/image/samsclub/0084265510166_A", "path": "ion-audio-charge-time-plus-various-colors-sam-s-clubhttps-scene7-samsclub-com-is-image-samsclub-0084265510166-a.jpg", "checksum": "5d935964adc027e15050a8fa714497b8"}, {"ur